def test_montar_json_result():
    elemento = {'id': 1, 'produto': 'Produto A', '2020': 10, '2021': 15}
    anos = ['2020', '2021', '2022']
    json_result = montar_json_result(elemento, anos)
    assert json_result['id'] == 1
    assert json_result['produto'] == 'Produto A'
    assert json_result['2020'] == 10
    assert json_result['2021'] == 15
    assert json_result['2022'] is None


